import React from 'react';
import {
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  List,
  ListItem,
  Checkbox,
  ListItemText
} from '@mui/material';

const CustomizeColumnsDialog = ({ 
  open, 
  onClose, 
  columns = [] // ✅ FIXED: Default to empty array to prevent .map() error
}) => {
  return (
    <Dialog open={open} onClose={onClose}>
      <DialogTitle>Customize Columns</DialogTitle>
      <DialogContent>
        <List>
          {columns.length > 0 ? (
            columns.map((column) => (
              <ListItem key={column.field}>
                <Checkbox checked={true} />
                <ListItemText primary={column.headerName} />
              </ListItem>
            ))
          ) : (
            <Typography variant="body2">No columns available.</Typography> // ✅ Prevents map() error
          )}
        </List>
      </DialogContent>
      <DialogActions>
        <Button onClick={onClose}>Close</Button>
      </DialogActions>
    </Dialog>
  );
};

export default CustomizeColumnsDialog;
